import RegistrationWithInput from "../reusable/registrationWithInputField";
import RegistrationWithCheckBox from "../reusable/registrationwithRadioButton/index"
import Button from 'react-bootstrap/Button'
let user = require("../../registration/registration");

const Registration = () => {
  return (
    <div>
      <label>Registration Form</label>
      <RegistrationWithInput inputProps= {user?.registrationWithInputFeild}/>
      <RegistrationWithCheckBox inputWithRadioButton= {user?.inputWithRadioButton}/>
      <Button >Sign Up</Button>
    </div>
  );
};

export default Registration;
